import React, {Component} from 'react'

class Navbar extends Component {
    //Our React Code
    render() {
        return (
            <div class="text-center" style={{
                color: "green",
                fontSize: 72 }}>
                <h1>Hello, World</h1>
            </div>
        )
    }
}

export default Navbar;
